import React from 'react';
import { View, Image, StyleSheet } from 'react-native';
import { homeIcon } from '../../utils/HomeData'
const HomeIcons = () => {
    return (
        <View style={styles.h_icons}>
            <View style={styles.h_flex}>
                <Image source={require("../assets/h_1.jpg")} style={styles.h_img} />
                <Image source={require("../assets/h_2.jpg")} style={styles.h_img} />
                <Image source={require("../assets/h_3.png")} style={styles.h_img} />
                <Image source={require("../assets/h_4.png")} style={styles.h_img} />
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    h_icons: {
        width: '100vw',
        backgroundColor: "#fff",
        boxShadow: ' rgba(0, 0, 0, 0.05) 0px 6px 24px 0px, rgba(0, 0, 0, 0.08) 0px 0px 0px 1px',
    },
    h_flex: {
        width: '95vw',
        padding: '10px',
        margin: 'auto',
        backgroundColor: "#ff",
        flex: 1,
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
    },
    h_img: {
        width: '20px',
        height: '30px',
        borderRadius: '50%',
        color: "#000",
    }

})

export default HomeIcons;
